ed context to 35 prolific years of Springsteen’s songwriting and home recording. “The ability to record at home whenever I wanted allowed me to go into a wide variety of different musical directions,” Springsteen explained. Throughout the set, that sonic experimentation takes the form of film soundtrack work (for a movie that was never made) on Faithless, country combos with pedal steel on Somewhere North of Nashville, richly woven border tales on Inyo, orchestra-driven, mid-century noir on Twilight Hours and E Street favored rock on Perfect World. Tracks II: The Lost Albums is available in limited-edition nine-LP and seven-CD formats, including original packaging for each previously unreleased record, with a 100-page cloth-bound, hardcover book featuring rare archival photos, liner notes on each lost album from essayist Erik Flannigan and a personal introduction on the project from Springsteen himself. CD Box Set Tracklist: LA Garage Sessions ’83 1. Follow That Dream 2. Don’t Back Down On Our Love 3. Little Girl Like You 4. Johnny Bye Bye 5. Sugarland 6. Seven Tears 7. Fugitive’s Dream 8. Black Mountain Ballad 9. Jim Deer 10. County Fair 11. My Hometown 12. One Love 13. Don’t Back Down 14. Richfield Whistle 15. The Klansman 16. Unsatisfied Heart 17. Shut Out The Light 18. Fugitive’s Dream (Ballad) Streets of Philadelphia Sessions 1. Blind Spot 2. Maybe I Don’t Know You 3. Something In The Well 4. Waiting On The End Of The World 5. The Little Things 6. We Fell Down 7. One Beautiful Morning 8. Between Heaven and Earth 9. Secret Garden 10. The Farewell Party Faithless 1. The Desert (Instrumental) 2. Where You Goin’, Where You From 3. Faithless 4. All God’s Children 5. A Prayer By The River (Instrumental) 6. God Sent You 7. Goin’ To California 8. The Western Sea (Instrumental) 9. My Master’s Hand 10. Let Me Ride 11. My Master’s Hand (Theme) Somewhere North Of Nashville 1. Repo Man 2. Tiger Rose 3. Poor Side of Town 4. Delivery Man 5. Under A Big Sky 6. Detail Man 7. Si eReplacementText":"Limited shipping areas"}},{"merchandiseItemRenderer":{"title":"Bruce Springsteen - Tracks II: The Lost Albums Vinyl Box Set","description":"Release Date: June 27, 2025 PLEASE NOTE: This is a pre-order item. All items in your order will ship on or around release date. If you would like to receive other items sooner, please place a separate order. Germany Customers Shop Here. TRACKS II: THE LOST ALBUMS are seven unheard Bruce Springsteen records made between 1983–2018. Featuring 82 previously unreleased songs, Tracks II: The Lost Albums fill in chapters of Springsteen’s expansive career timeline, while offering invaluable insight into his life and work as an artist. “The Lost Albums were full records, some of them even to the point of being mixed and not released,” said Springsteen. “I’ve played this music to myself and often close friends for years now. I’m glad you’ll get a chance to finally hear them. I hope you enjoy them.” From the lo-fi exploration of LA Garage Sessions ’83, serving as a crucial link between Nebraska and Born in the U.S.A., to the drum loop and synthesizer sounds of Streets of Philadelphia Sessions. Tracks II: The Lost Albums offers unprecedented context to 35 prolific years of Springsteen’s songwriting and home recording. “The ability to record at home whenever I wanted allowed me to go into a wide variety of different musical directions,” Springsteen explained. Throughout the set, that sonic experimentation takes the form of film soundtrack work (for a movie that was never made) on Faithless, country combos with pedal steel on Somewhere North of Nashville, richly woven border tales on Inyo, orchestra-driven, mid-century noir on Twilight Hours and E Street favored rock on Perfect World. Tracks II: The Lost Albums is available in limited-edition nine-LP and seven-CD formats, including original packaging for each previously unreleased record, with a 100-page cloth-bound, hardcover book featuring rare archival photos, liner notes on each lost album from essayist Erik Flannigan and a personal introduction on the project from Springsteen himself. Vinyl Box Set Tracklist: LA Garage Sessions ’83 Side A 1. Follow That Dream 2. Don’t Back Down On Our Love 3. Little Girl Like You 4. Johnny Bye Bye 5. Sugarland 6. Seven Tears Side B 1. Fugitive’s Dream 2. Black Mountain Ballad 3. Jim Deer 4. County Fair Side C 1. My Hometown 2. One Love 3. Don’t Back Down 4. Richfield Whistle Side D 1. The Klansman 2. Unsatisfied Heart 3. Shut Out The Light 4. Fugitive’s Dream (Ballad) Streets of Philadelphia Sessions Side A 1. Blind Spot 2. Maybe I Don’t Know You 3. Something In The Well 4. Waiting On The End Of The World 5. The Little Things Side B 1. We Fell Down 2. One Beautiful Morning 3. Between Heaven and Earth 4. Secret Garden 5. The Farewell Party Faithless Side A 1. The Desert (Instrumental) 2. Where You Going, Where You From 3. Faithless 4. All God’s Children 5. A Prayer By The River (Instrumental) 6. God Sent You Side B 1. Goin’ To California 2. The Western Sea (Instrumental) 3. My Master’s Hand 4. Let Me Ride 5. My Master’s Hand (Theme) Somewhere North Of Nashville Side A 1. Repo Man 2. Tiger Rose 3. Poor Side of Town 4. Delivery Man 5. Under A Big Sky 6. Detail Man Side B 1. Silver Mountain 2. Janey Don’t You Lose Heart 3. You’re Gonna Miss Me When I’m Gone 4. Stand On It 5. Blue Highway 6. Somewhere North of Nashville Inyo Side A 1. Inyo 2. Indian Town 3. Adelita 4. The Aztec Dance 5. The Lost Charro Side B 1. Our Lady of Monroe 2. El Jardinero (Upon the Death of Ramona) 3. One False Move 4. Ciudad Juárez 5. When I Build My Beautiful House Twilight Hours Side A 1. Sunday Love 2. Late in the Evening 3. Two of Us Side B 1. Lonely Town 2. September Kisses 3. Twilight Hours Side C 1. I’ll Stand By You) 2. High Sierra 3. Sunliner Side D 1. Another You 2. Dinner at Eight 3. Follow The Sun Perfect World Side A 1. I'm Not Sleeping 2. Idiot’s Delight 3. Another Thin Line 4. The Great Depression 5. Blind Man
